Компания МАЯК предлагает две линейки блейд платформ для работы высокопроизводительных компьютеров или корпоративных приложений, которая оптимально подходит для центров данных, виртуализации, для решения критически важных, ответственных задач и высокопроизводительных вычислений:
- Шасси блейд-сервера с конвергированной инфраструктурой HW-OKA-E9. Сервер является мощной платформой для работы высокопроизводительных компьютеров или корпоративных приложений, оптимально подходит для центров данных, виртуализации, для решения критически важных, ответственных задач и высокопроизводительных вычислений.16 слотов в стативе 12U, в том числе резервные модули питания (PSU), модули рассеивания тепла, модули управления и модули коммутации. Данная платформа с конвергентной инфраструктурой отличается оптимизированным расположением, что позволяет рационально использовать имеющее пространство.
Шасси HW-OKA-E9 можно установить в стандартный 19-дюймовый статив глубиной не менее 1 м. Статив имеет источники питания АС или DC, что соответствует требованиям центров обработки данных.сесторонняя масштабируемость позволяет серверам Е9 поддерживать широкий спектр услуг с 48 модулями DIMM и 15 2,5-дюймовыми жесткими дисками в слоте полной ширины, имеющем вычислительные узлы с 2 и 4 разъемами и поддерживающем ускорение I/O с использованием GPU, PCIe SSD и GPU для выполнения общих вычислений (GPGPU);
Модуль коммутации HW-OKA-E9 обрабатывает различные услуги посредством модулей GE, 10 GE, 40 GE, FC, FCoE и InfiniBand FDR, поддерживающих расширение до 100 GE и InfiniBand EDR;
Система водяного охлаждения обеспечивает экономию энергопотребления на 40% и повышение эффективности энергопотребления (PUE ≤ 1.1);
Функции динамического управления мощностью и модули электропитания Platinum AC PSU с эффективностью преобразования более 95% минимизируют энергопотребление и рассеивание тепла;
Пассивная соединительная плата предотвращает возникновение единых точек отказа, в то время как модули, поддерживающие полное резервирование, обеспечивают плавное переключение.
- Блейд-сервер линейки SU-OKA-TC представляет собой суперкомпьютер, обладающий огромными возможностями вычисления. Система рекомендуется к использованию в средах, которым от оборудования требуется повышенная производительность. Устройства имеют расширенный функционал, работают стабильно, ресурсы здесь размещены максимально плотно. Кроме того, производители снабдили платформу инновационным механизмом охлаждения, способным оперативно отводить тепло от рабочих компонентов, что служит дополнительным гарантом стабилизации системы. Еще одним плюсом является то, что блейд сервер потребляет минимум энергии даже при работе с ресурсоемкими программными продуктами.
В системах SU-OKA-TC применяются процессоры Intel Xeon E5-2600, оптимизированные для работы в центрах информационной обработки и корпоративных средах.
Оперативная память формата DDR4 организована по модульному принципу, она устанавливается в один из 16 слотов DIMM. Пользователю доступны конфигурации и на 24 отсека.
Платформа реализуется в форм-факторе 5U. Возможности сервера можно постепенно расширять, максимальное количество съемных блейд модулей – 10 шт..
Сетевые компоненты представлены 4-мя портами 1 GbE, а также 2-мя дополнительными разъемами 10 GbE. Кроме этого, в структуре устройства имеется гнездо InfiniBand (рабочая скорость - 56 Гбит/сек).
В блок питания входят платиновые компоненты, обеспечивающие сниженное потребление энергии и стабильную работу при любой нагрузке.
